import GetUsers from "./getUsers";

export function VerifyIfExistUser (username: string, password: string) {
  GetUsers().then(users => {
    const foundedUser = users.find((user: any) => {
      const verify = user.nome === username &&
                     user.senha === password
      return verify
    })
    return foundedUser
  }).catch(error => {
    console.error(error)
  })
}
